charValues = {")":3, "]":57, "}":1197, ">":25137}


def numFind(n):
    scores = []
    for row in n:
        runningList = []
        for col in row:
            if col in openChars:
                runningList.append(col)
            if col in closeChars:
                popped = runningList.pop(-1)
                if popped != oppositeChars[col]:
                    print("Expected {}, but found {} instead".format(oppositeChars[popped], col))
                    scores.append(charValues[col])
    return sum(scores)


